import * as React from 'react';

import { StuntsContext } from '../../contexts/stunts';

// Get mock data
import stunts from '../../providers/stunts';

export const PeopleProvider = (props: any) => {
  return <StuntsContext.Provider value={{ stunts }}>{props.children}</StuntsContext.Provider>;
};
